import React from 'react';
import Sidebar from './Sidebar';
import '../css/app.css';
import Mainpage from './Mainpage';
import Finalform from './Finalform';

import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="main">
        <div className="plan">
          <Sidebar></Sidebar>
          <Route path="/yourinfo">
            <Finalform></Finalform>
          </Route>
        </div>
      </div>
    </Router>
  );
}

export default App;
